    private static boolean printFail(UserAgentValue v, Browser b)
    {
        System.out.println("FAILED - DETECTED:'" + b + "' - WAS:'" + v.type + (v.majorVersion == null ? "" : "v" + v.majorVersion) + "' - UA: '" + v.userAgent + "'");
        return false;
    }

    private static final class UserAgentValue
    {
        protected final String userAgent;
        protected final Browser.Type type;
        protected final Integer majorVersion;

        private UserAgentValue(String userAgent, Browser.Type type, Integer majorVersion)
        {
            this.userAgent = userAgent;
            this.type = type;
            this.majorVersion = majorVersion;
        }
    }

    private static void addValue(Browser.Type type, Integer majorVersion, String userAgent)
    {
        values.add(new UserAgentValue(userAgent, type, majorVersion));
    }
